let display;
document.onclick = function() {
	let linije = [...document.getElementsByClassName("st1"), ...document.getElementsByClassName("st2")];
	display = display == "initial" ? "none" : "initial";
	// console.log(display);
	for (let i = 0; i < linije.length; i++) {
		linije[i].style = "display: " + display
	}
}
